This is the complete Extended Backus Normal Form (eBNF) grammar definition for Tortuga. The syntactic grammar of Tortuga is used to parse a linear sequence of tokens into a nested syntax tree structure. The root of the grammar matches an entire Tortuga program (or a sequence of comparisons to make the interpreter more useful). program = expressions | comparisons EOF ;
expressions = expression+ ;
comparisons = expression comparison+ ;
comparison = comparator expression ;

29.body:
A program is a series of expressions. Expressions produce values. Tortuga has a number of binary operators with different levels of precedence. Some grammars for languages do not directly encode the precedence relationships and specify that elsewhere. Here, we use a separate rule for each precedence level to make it explicit. expression = assignment | arithmetic ;
assignment = function "=" block ;
block = "[" expression expression+ "]" | expression ; arithmetic = epsilon ;
epsilon = modulo ( "~" modulo )? ;
modulo = sum ( "%" sum )* ;
sum = product ( ( "+" | "-") product )* ;
product = power ( ( "*" | "/" ) power )* ;
power = primary ( "^" primary )* ; primary = number | call | grouping ;
number = "-"? NUMBER ;
call = IDENTIFIER arguments* ;
grouping = "(" expression ")" ;

30.body:
The grammar allows pattern-matching in function definitions instead of having built-in control flow. These rules define the allowed patterns. pattern = function | refinement | bounds ;
function = name parameters? ;
refinement = name comparator arithmetic ;
bounds = arithmetic inequality name inequality arithmetic ;

31.body:
To keep the above rules a little cleaner, some grammar is split out into a few reused helper rules. arguments = "(" expression ( "," expression )* ")" ;
parameters = "(" pattern ( "," pattern )* ")" ; name = "_" | "@" IDENTIFIER ;
inequality = "<" | "<=" | ">" | ">=" ;
equality = "=" | "<>" ;
comparator = equality | inequality ;

