The lexical grammar is used during lexical analysis to group characters into tokens. Where the syntax is context free , the lexical grammar is regular -- note that there are no recursive rules. IDENTIFIER = XID_START XID_CONTINUE* ;
NUMBER = NONZERO DIGIT? "#" ( "0" | NATURAL | REAL | FRACTION) ;
NATURAL = NZ_ALPHANUM ALPHANUM* ( "." "0"? )? ;
REAL = NZ_ALPHANUM ALPHANUM* "." ALPHANUM*? NZ_ALPHANUM ;
FRACTION = "0"? "." ALPHANUM*? NZ_ALPHANUM ; NZ_ALPHANUM = NZ_DIGIT | ALPHA ; ALPHANUM = DIGIT | ALPHA ;
ALPHA = "a" ... "z" | "A" ... "Z" ;
NZ_DIGIT = "1" ... "9" ;
DIGIT = "0" ... "9" ;
